import React from 'react';
import './App.css';
import ExpenseItem from './Components/Expenses/ExpenseItem';
import Card from './Components/Cards/Card';
import NewExpenses from './Components/NewExpenses/NewExpenses';

function App(props) {
  const expense = [
    {
      title: "car Insurance",
      price: 24.15,
      date: new Date(2021, 3, 23),
    },
    {
      title: "paper Insurance",
      price: 60.15,
      date: new Date(2020, 4, 3),
    }
  ]
  const AddExpense=(expenses)=>{
    console.log("render in app js")
    console.log(expenses)
  }
  return (
    <div>
      <NewExpenses onAddExpense={AddExpense} />
      <Card className="expenses">
        {props.item.map(expense => <ExpenseItem title={expense.title} price={expense.price} date={expense.date}/>)}


      </Card>
    </div>
  );
}

export default App;
